  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`Find tutorials, examples and technical articles that will help you to develop with Redis and Rust.`}</p>
    <h3 {...{
      "id": "getting-started"
    }}>{`Getting Started`}</h3>
    <p>{`Rust community has built many client libraries that you can find here. For your first steps with Java and Rust, this article will show how to use a popula library: redis-rs
The web page “Redis Enterprise and Rust” will help you to get started with Redis Enterprise and Rust in a much easier manner.
redis-rs is a rust implementation of a Redis client library.
It exposes a general purpose interface to Redis and also provides specific helpers for commonly used functionality.`}</p>
    <Tabs defaultValue="redis-rs" values={[{
      label: 'Redis-rs',
      value: 'redis-rs'
    }]} mdxType="Tabs">
  <TabItem value="redis-rs" mdxType="TabItem">
        <h3 {...{
          "id": "step-1-install-rust"
        }}>{`Step 1. Install Rust`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` curl --proto '=https' --tlsv1.2 -sSf https://sh.rustup.rs | sh
`}</code></pre>
        <h3 {...{
          "id": "step-2-configure-your-current-shell"
        }}>{`Step 2. Configure your current shell:`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` source $HOME/.cargo/env
`}</code></pre>
        <h3 {...{
          "id": "step-3-verify-rust-compiler"
        }}>{`Step 3. Verify Rust compiler:`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` rustc --version
 rustc 1.49.0
`}</code></pre>
        <h3 {...{
          "id": "step-4-creating-cargotoml-with-redis-dependency"
        }}>{`Step 4. Creating Cargo.toml with Redis dependency:`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` [dependencies]
 redis = "0.8.0"
`}</code></pre>
        <h3 {...{
          "id": "step-5-clone-the-repository"
        }}>{`Step 5. Clone the repository`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` git clone https://github.com/redis-developer/redis-rust-getting-started
`}</code></pre>
        <h3 {...{
          "id": "step-6-run-the-application"
        }}>{`Step 6. Run the application`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` cargo run
`}</code></pre>
        <h3 {...{
          "id": "further-references"
        }}>{`Further References`}</h3>
        <ul>
          <li parentName="ul"><a parentName="li" {...{
              "href": "https://redislabs.com/lp/redis-enterprise-rust/"
            }}>{`Redis Enterprise and Rust`}</a></li>
          <li parentName="ul"><a parentName="li" {...{
              "href": "https://github.com/redis-developer/redis-rust-getting-started"
            }}>{`Getting Started with Redis & Rust`}</a></li>
        </ul>
  </TabItem>
    </Tabs>

    </MDXLayout>;
